          textAnchor: "start",
          style: {
            colors: ["#fff"],
          },
        },
        legend: {
          show: false,
        },
        bar: {
          barWidth: "10%",
        },
      },
    },
  },
  {
    title: "Milestone Status",
    data: {
      series: [56, 22, 22],
      options: {
        colors: ["#0878FF", "#5AE1E2", "#E6ECF6"],
