          barWidth: "10%",
        },
      },
    },
  },
];
// index
export const ProjectDetails = () => {
  return (
    <>
      <div className="custom_container">
        <PageAllTopTitle link={-1} icon={<BsArrowLeft />} title="Project" />
        <div className="row g-xxl-4 g-xl-4 g-lg-4 g-md-4 g-sm-3 g-3 ">
          <div className="col-12">
            <ProjectDetailsCard />
          </div>
          <div className="col-12">
            <MyTab />
          </div>
        </div>
      </div>
    </>
